MEET K9 SUMMIT!!!!

Our team has GROWN & I am so eager to introduce everyone to you!! K9 Summit is an ALL FEMALE team of professional dog trainers, located in Chattanooga, TN. Each of our trainers has their own IG page, so be sure to follow each & every account!!

In just a year & a half, we went from two trainers to EIGHT trainers. We weren’t even looking to grow.. But as business grew, so did the team. And I wouldn’t have it any other way!! So get to know us!! 

Sierra - Hi! I’m the owner & founder of K9 Summit. In 2021, I had been training pups for about two years & decided it was time for something bigger! I launched K9 Summit on Jan 1, 2022 with just one other trainer, Kayla. I am the one behind this IG account, but I am just one part of this amazing team of strong, beautiful women. 

@kayla_k9summit - This powerhouse of a trainer started with K9 Summit as our Service Dog Director/trainer. She is still training service dogs, but is slowly focusing more & more on pet dogs as she is now also a brand new mom to her beautiful daughter, Selena! Kayla is incredibly brilliant, kind, loyal and we wouldn’t be where we are without her. 

@kaitlyn_k9summit - Also known as THE funny one on the team. She brings the chaos & humor to our Instagram content as I’m sure most of you know by now. Kaitlyn joined the team in March of 2022 and is now one of our incredible behavior modification trainers. She keeps everything real (but funny!) and I couldn’t imagine our team without her. 

@mirabel_k9summit - Mirabel moved here ALL the way from Arizona.. JUST for this job. Mirabel was already professionally training back in AZ when K9 Summit caught her attention via Instagram! In just a few months, she was living in Chatt and an incredible addition to our team. Not only is she one of our behavior modification trainers, she also beautifully writes & designs our digital training workbooks/guides. Her creativity is unmatched. We are so thankful for our Mirabel!

